export const FOUNDRY_DIGITAL_FONT_DOT_LED =
  '';
export const FOUNDRY_DIGITAL_FONT_LED =
  '';

export function ensureLedFont() {
  const FONT_STYLE_ID = 'foundry-digital-led-font';
  if (document.getElementById(FONT_STYLE_ID)) return;

  const style = document.createElement('style');
  style.id = FONT_STYLE_ID;
  style.textContent = `
    @font-face {
      font-family: 'ds-digitalnormal';
      src: url("data:font/woff2;base64,${FOUNDRY_DIGITAL_FONT_LED}") format("woff2");
      font-weight: normal;
      font-style: normal;
      font-display: swap;
    }
    @font-face {
      font-family: 'ds-digitaldot';
      src: url("data:font/woff2;base64,${FOUNDRY_DIGITAL_FONT_DOT_LED}") format("woff2");
      font-weight: normal;
      font-style: normal;
      font-display: swap;
    }
  `;
  document.head.appendChild(style);
}
